import React, { useState } from 'react';
import axios from 'axios';
import { useAuth } from './AuthContext';
import { Button, TextField, Typography, Container, Box } from '@mui/material';
import { Link } from 'react-router-dom';

const NewNomineeForm = () => {
  const [formData, setFormData] = useState({
    first_name: '',
    last_name: '',
    department_name: '',
    job_category: '',
    email: '',
    nominator_qualification: '',
    college_name: '',
    location: '',
    degree: '',
    program: '',
    graduation_year: ''
  });

  const { authToken, userId } = useAuth();

  const handleChange = e => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const nomineeData = {
        ...formData,
        user_id: userId
    };

    try {
      // First, submit the nominee creation request
      const response = await axios.post('http://127.0.0.1:5000/nominee/create', nomineeData, {
          headers: {
              'Content-Type': 'application/json',
              'Authorization': `Bearer ${authToken}`
          }
      });
      console.log('Nominee created:', response.data);

      // Check if nominee creation was successful and get the ID
      if (response.data && response.data.id) {
          const educationData = {
              nominee_id: response.data.id,
              college_name: formData.college_name,
              location: formData.location,
              degree: formData.degree,
              program: formData.program,
              graduation_year: formData.graduation_year
          };

          // Now, submit the education details for the newly created nominee
          const eduResponse = await axios.post('http://127.0.0.1:5000/nominee/education/add', educationData, {
            headers: {
                'Content-Type': 'application/json',
                'Authorization': `Bearer ${authToken}`
            }
          });
          console.log('Education added:', eduResponse.data);
      } else {
          console.error('Failed to create nominee, no ID returned');
      }
    } catch (error) {
      console.error('Error submitting data:', error.response ? error.response.data : "No response");
    }
  };

  return (
    <Container>
      <Typography variant="h6" gutterBottom>New Nominee Form Information</Typography>
      <form onSubmit={handleSubmit}>
        <TextField fullWidth label="Nominee First Name" name="first_name" value={formData.first_name} onChange={handleChange} variant="outlined" margin="normal" />
        <TextField fullWidth label="Nominee Last Name" name="last_name" value={formData.last_name} onChange={handleChange} variant="outlined" margin="normal" />
        <TextField fullWidth label="Department Name" name="department_name" value={formData.department_name} onChange={handleChange} variant="outlined" margin="normal" />
        <TextField fullWidth label="Job Category" name="job_category" value={formData.job_category} onChange={handleChange} variant="outlined" margin="normal" />
        <TextField fullWidth label="Email" name="email" type="email" value={formData.email} onChange={handleChange} variant="outlined" margin="normal" />
        <TextField fullWidth label="Nominator Qualification" name="nominator_qualification" value={formData.nominator_qualification} onChange={handleChange} variant="outlined" margin="normal" multiline rows={4} />
        <TextField fullWidth label="College Name" name="college_name" value={formData.college_name} onChange={handleChange} variant="outlined" margin="normal" />
        <TextField fullWidth label="Location" name="location" value={formData.location} onChange={handleChange} variant="outlined" margin="normal" />
        <TextField fullWidth label="Degree" name="degree" value={formData.degree} onChange={handleChange} variant="outlined" margin="normal" />
        <TextField fullWidth label="Program" name="program" value={formData.program} onChange={handleChange} variant="outlined" margin="normal" />
        <TextField fullWidth label="Graduation Year" name="graduation_year" type="date" value={formData.graduation_year} onChange={handleChange} variant="outlined" margin="normal" InputLabelProps={{ shrink: true }} />
        <Box display="flex" justifyContent="space-between" mt={2}>
          <Button type="submit" variant="contained" color="primary">Submit New Nominee</Button>
          <Button variant="contained" color="primary" component={Link} to="/nominee/dashboard">
            Back to Dashboard
          </Button>
        </Box>


      </form>
    </Container>
  );
};

export default NewNomineeForm;
